import React from 'react';

const styles = {
    images: {
        height: "150px",
        width: "150px",
        backgroundColor: "red",
        margin: "8px 25px",
      },
    container:{
        paddingTop: "50px",
        paddingBottom: "50px",
        display: "flex",
        flexWrap: "wrap",


    }
  };

function Game (){
    return(
        <main class="container" style={styles.container}>
            <div role="img" aria-label="click item" class="click-item" style={styles.images}>
            </div>
            <div role="img" aria-label="click item" class="click-item" style={styles.images}>
            </div>
        </main>
    );
}

export default Game;
